import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import {

  getEmployeeProfileView,
} from "../../../actions/EmplyeeActions";
import "../employeeProfile.js/employeeProfile.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import RemoveRedEyeIcon from "@mui/icons-material/RemoveRedEye";
import "swiper/css/effect-coverflow";
import CloseIcon from '@mui/icons-material/Close';
import "swiper/css/pagination";
import { EffectCoverflow, Pagination } from "swiper";
import { useNavigate, useParams } from "react-router-dom";
import SwipPage from '../../../components/EmployeeComponents/Swiper/SwipPage'

const EmployeePublicView = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  let { userId } = useParams();

  const userProfile = useSelector((state) => state.emplyeePublicData);

  const user = useSelector((state) => state.user);
  const [title, setTitle] = useState("");
  const [imgUlr, setImgUrl] = useState("");
  const [description, setDescription] = useState("");
  const [showPortfolio, setShowPortfolio] = useState("");
  const [Id, setId] = useState("");

  const { userData } = userProfile;

  useEffect(() => {
    if (!user?.userInfo) {
      navigate("/login");
    }

    dispatch(getEmployeeProfileView(userId));
  }, [user]);

  return (
    <div>
      {userProfile?.error ? (
        <div
          style={{
            width: "100%",
            height: "90vh",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <img
            src="https://cdn.dribbble.com/users/1554526/screenshots/3399669/media/51c98501bc68499ed0220e1ba286eeaf.png?compress=1&resize=400x300&vertical=top"
            alt=""
          />
        </div>
      ) : (
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
          }}
          className="emplyeeProfile"
        >
          <div className="box1">
            <div className="top">
              <div className="left">
                <div className="img-box">
                  {userData?.image ? (
                    <img src={userData?.image} alt="" />
                  ) : (
                    <img
                      src="https://t3.ftcdn.net/jpg/03/46/83/96/360_F_346839683_6nAPzbhpSkIpb8pmAwufkC7c5eD7wYws.jpg"
                      alt=""
                    />
                  )}
                </div>

                <div>
                  {" "}
                  <p className="common-heading">{userData?.owner?.name}</p>
                  <p
                    style={{
                      marginLeft: "30px",
                      marginTop: "-10px",
                      fontSize: "14px",
                      display: "flex",
                    }}
                  >
                    <strong>since :</strong>{" "}
                    <p style={{ color: "#3CCF4E", marginLeft: "10px" }}>
                      {userData?.owner?.createdAt.slice(0, 10)}
                    </p>
                  </p>
                </div>
              </div>

              <div className="rigth">
                {" "}
                <button>message</button>{" "}
              </div>
            </div>

            <div className="bottom">
              <div className="left">
                <div className="left-top">
                  <span>
                    <strong>{userData?.totalEarned}</strong>
                    <p>Total Earnings</p>
                  </span>

                  <span>
                    <strong>{userData?.workHistory.length}</strong>
                    <p>Total Jobs</p>
                  </span>
                </div>

                <div className="left-bottom">
                  <span>
                    <h5>Language </h5>
                    {userData?.languages.map((language) => {
                      return (
                        <p key={language?.language} style={{ marginLeft: "0px" }}>
                          {language?.language}
                        </p>
                      );
                    })}
                  </span>

                  <span>
                    <h5>Skills </h5>

                    {userData?.skills.map((education) => {
                      return (
                        <li key={education?.skill} style={{ marginLeft: "0px" }}>
                          {education?.skill}
                        </li>
                      );
                    })}
                  </span>

                  <span>
                    <h5>Education </h5>
                    {userData?.educations.map((education) => {
                      return (
                        <ul key={education?._id}>
                          <li>
                            <strong>{education?.school}</strong>{" "}
                          </li>
                          <li>{education?.title}</li>
                        </ul>
                      );
                    })}
                  </span>
                </div>
              </div>

              <div className="right">
                <h1 >
                  {userData?.userTitle}
                </h1>
                <p >{userData?.userInfo}</p>
              </div>
            </div>
          </div>

          <div className="box2">
            <div className="top">
              <p className="common-heading">Work History</p>
            </div>

            <div className="body">
              <div className="left">
                <h4>Make a website</h4>
                <div className="left-text">
                  <strong>$25.00</strong>
                  <p>Successfully Completed</p>
                </div>
              </div>

              <button></button>
            </div>
          </div>

          <div className="box3 mb-5">
            <div className="top" style={{ display: "flex" }}>
              <p className="common-heading">Portfolio</p>
            </div>
            <div className="bottom">
              <Swiper
                effect={"coverflow"}
                grabCursor={true}
                centeredSlides={true}
                slidesPerView={"4"}
                coverflowEffect={{
                  rotate: 80,
                  stretch: 0,
                  depth: 10,
                  modifier: 1,
                  slideShadows: false,
                }}
                pagination={true}
                modules={[EffectCoverflow, Pagination]}
                className="mySwiper"
                style={{ width: "1000px" }}
              >
                {userData?.portfolios[0]?.Image ? (
                  <SwiperSlide
                    style={{
                      height: "350px",
                      width: "200px",
                      display: "flex",
                      flexDirection: "column",
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                    className="swiperImg"
                  >
                    <img
                      style={{ height: "200px", width: "200px" }}
                      src={userData?.portfolios[0]?.Image}
                    />
                    <button
                      onClick={() => {
                        setTitle(userData?.portfolios[0]?.title);
                        setDescription(userData?.portfolios[0]?.description);
                        setShowPortfolio("portfolio");
                        setImgUrl(userData?.portfolios[0]?.Image);
                        setId(userData?.portfolios[0]?._id);
                      }}
                      style={{ marginLeft: "0px" }}
                      className="editIco mt-2 mb-2"
                    >
                      <RemoveRedEyeIcon />
                    </button>
                  </SwiperSlide>
                ) : (
                  ""
                )}

                {userData?.portfolios[1]?.Image ? (
                  <SwiperSlide
                    style={{
                      height: "350px",
                      width: "200px",
                      display: "flex",
                      flexDirection: "column",
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                    className="swiperImg"
                  >
                    <img
                      style={{ height: "200px", width: "200px" }}
                      src={userData?.portfolios[1]?.Image}
                    />
                    <button
                      onClick={() => {
                        setTitle(userData?.portfolios[1]?.title);
                        setDescription(userData?.portfolios[1]?.description);
                        setShowPortfolio("portfolio");
                        setImgUrl(userData?.portfolios[1]?.Image);
                        setId(userData?.portfolios[1]?._id);
                      }}
                      style={{ marginLeft: "0px" }}
                      className="editIco mt-2 mb-2"
                    >
                      <RemoveRedEyeIcon />
                    </button>
                  </SwiperSlide>
                ) : (
                  ""
                )}

                {userData?.portfolios[2]?.Image ? (
                  <SwiperSlide
                    style={{
                      height: "350px",
                      width: "200px",
                      display: "flex",
                      flexDirection: "column",
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                    className="swiperImg"
                  >
                    <img
                      style={{ height: "200px", width: "200px" }}
                      src={userData?.portfolios[2]?.Image}
                    />
                    <button
                      onClick={() => {
                        setTitle(userData?.portfolios[2]?.title);
                        setDescription(userData?.portfolios[2]?.description);
                        setShowPortfolio("portfolio");
                        setImgUrl(userData?.portfolios[2]?.Image);
                        setId(userData?.portfolios[2]?._id);
                      }}
                      style={{ marginLeft: "0px" }}
                      className="editIco mt-2 mb-2"
                    >
                      <RemoveRedEyeIcon />
                    </button>
                  </SwiperSlide>
                ) : (
                  ""
                )}

                {userData?.portfolios[3]?.Image ? (
                  <SwiperSlide
                    style={{
                      height: "350px",
                      width: "200px",
                      display: "flex",
                      flexDirection: "column",
                      alignItems: "center",
                      justifyContent: "center",
                    }}
                    className="swiperImg"
                  >
                    <img
                      style={{ height: "200px", width: "200px" }}
                      src={userData?.portfolios[3]?.Image}
                    />
                    <button
                      onClick={() => {
                        setTitle(userData?.portfolios[3]?.title);
                        setDescription(userData?.portfolios[3]?.description);
                        setShowPortfolio("portfolio");
                        setImgUrl(userData?.portfolios[3]?.Image);
                        setId(userData?.portfolios[3]?._id);
                      }}
                      style={{ marginLeft: "0px" }}
                      className="editIco mt-2 mb-2"
                    >
                      <RemoveRedEyeIcon />
                    </button>
                  </SwiperSlide>
                ) : (
                  ""
                )}
              </Swiper>
            </div>
          </div>

          <Swiper
                effect={"cards"}
                grabCursor={true}
                modules={[EffectCards]}
                className="mySwipe"
              >
                {userData?.portfolios[0]?.Image ? (
                  <SwiperSlide>
                    <img
                      className="swp-img"
                      src={userData?.portfolios[0]?.Image}
                      alt=""
                    />{" "}
                    <button
                      onClick={() => {
